import React, { Component } from "react";
import "./index.css"
export default class List extends Component {
  state={
    user:[{id:1,src:"./src/ncu.jpg"},{id:2,src:"./src/ncu.jpg"}]
  }
  render() {
    return <div className="cs-List-x">
                {this.state.user.map((item)=>{
                    return (
                        <a href="http://www.ncu.edu.cn /" className="cs-List-navi">
                            <img src={item.src} className="cs-List-img"/>
                        </a>
                    )
                })}
            </div>;
  }
}
